import React, { Component } from 'react'
import WrapComponents from '@/components/wrapper'
import './index.scss'
import CreateSegementation from './createSegment'
import { LargeHeading } from '@/components/headings/index'

class Segementation extends Component {
    render() {
        return (
            <WrapComponents>
                <LargeHeading className="green-text">Segmentation :</LargeHeading>
                <CreateSegementation />
            </WrapComponents>
        )
    }
}

export default Segementation
